const ListaProductos = ({productos, cart, setCart}) => {
    return(
        <>
        <h4>Productos</h4>
        <div>
            {productos?.map(prod => <Items producto={prod} key={prod.id} cart={cart} setCart={setCart} />)}
        </div>
        </>
    )
}
export default ListaProductos
